INSERT INTO `tb_soal` (`id_soal`, `id_kelompok_soal`, `id_mata_uji`, `slug_soal`, `soal_1`, `soal_2`, `posisi_gambar`, `gambar_soal`, `jawaban_benar`, `status_soal`, `status_data`) VALUES
(1, 2, 5, '57e399713u0148e49166', '<p>Bentuk sederhana dari $\\frac{\\left(5 x^{-1} y^{2}\\right)\\left(4 x^{2} y^{3}\\right)^{2}}{\\left(2 x y^{-2}\\right)^{3}}$ adalah …</p>', '', '', 'default.jpg', 3, 1, 0),
(2, 2, 5, '669uo6u2a390a2o99u61', '<p>Bentuk pangkat positif dari&nbsp; $\\left(y^{-1}+x^{-1}\\right)^{-1}\\left(x^{-2}-y^{-2}\\right)$ dapat dinyatakan sebagai ....</p>', '', '', 'default.jpg', 5, 1, 0),
(3, 2, 5, '4a48u6u8u57u21oo1u29', '<p>Bentuk sederhana dari&nbsp; $(2 \\sqrt{3}-3)(2+\\sqrt{3})$</p><p>adalah ....</p>', '', '', 'default.jpg', 3, 1, 0),
(4, 2, 5, 'a20ea50ae1773oao8294', '<p align=\"left\">Bentuk sederhana dari &nbsp;$\\frac{3}{\\sqrt{5}-\\sqrt{2}}$ adalah ….</p>', '', '', 'default.jpg', 4, 1, 0),
(5, 2, 5, '7706au22eoo705863768', '<p>Diketahui $a \\log 2+b \\log 3+c \\log 4+d \\log 5=2021$ &nbsp;Nilai&nbsp; $2 a+3 b+4 c+d$ adalah ....</p>', '', '', 'default.jpg', 3, 1, 0),
(6, 2, 5, '34u9e207ae80587o9159', '<p>Untuk menghadapi&nbsp; kompetisi sepak takraw, terdapat&nbsp; 7 finalis yang akan dipilih untuk menjadi&nbsp; satu team yang solid, maka banyaknya susunan&nbsp; yang mungkin terjadi adalah ….</p>', '', '', 'default.jpg', 2, 1, 0),
(7, 2, 5, '439e206uu841a30a7uo7', '<p>Pada pelemparan dua buah dadu,&nbsp; munculnya mata dadu dengan jumlah 7 atau 11 adalah .…</p>', '', '', 'default.jpg', 5, 1, 0),
(8, 2, 5, 'au08a11ua18uuo55962o', '<p>3 orang siswa kelas X, 5 orang siswa kelas XI dan 2 orang siswa keals XII diseleksi untuk menduduki jabatan sebagai pengurus OSIS. Akan ditunjuk 2orang siswa sebagai ketua dan sekretaris OSIS. Jika siswa yang terpilih haruslah dari kelas berbeda dan posisi ketua harus berasal dari kelas yang lebih tinggi dari sekretaris, maka peluang terpilihnya dua orang siswa tersebut adalah....</p>', '', '', 'default.jpg', 5, 1, 0),
(9, 2, 5, '77a4306190e99a1aue5o', '<p>Diketahui &nbsp;$\\mathrm{A}=\\left[\\begin{array}{cc}-3 &amp; -2 \\\\ 4 &amp; -1\\end{array}\\right]$ dan $\\mathrm{B}=\\left[\\begin{array}{cc}4 &amp; 3 \\\\ -2 &amp; -1\\end{array}\\right]$ &nbsp;maka A.B adalah ....</p>', '', '', 'default.jpg', 4, 1, 0),
(10, 2, 5, '0oe6206a5o6u7ae18243', '<p>Vaksinasi harus diberikan kepada ayam, sebagai bentuk kekebalan terhadap suatu penyakit. Setiap 100 ekor ayam, minimal memerlukan 9 unit zat A dan 15 unit zat B. Di pasar tersedia dua jenis vaksin, yaitu VAKSINO dan VAKSINI. Satu bungkus VAKSINO mengandung 1 unit zat A dan 2 unit zat B, sedangkan satu bungkus VAKSINI mengandung 2 unit zat A dan 1 unit zat B. Banyak VAKSINO dan VAKSINI yang diperlukan untuk 100 ekor ayam adalah ....</p>', '', '', 'default.jpg', 5, 1, 0),
(11, 2, 5, '6469348o806aoo21049o', '<p>Jika &nbsp;$A\\left[\\begin{array}{cc}1 &amp; -1 \\\\ 2 &amp; 1\\end{array}\\right] B\\left[\\begin{array}{ll}2 &amp; 1 \\\\ 3 &amp; 2\\end{array}\\right]$ dan $C\\left[\\begin{array}{cc}3 &amp; 2 \\\\ 1 &amp; -1\\end{array}\\right]$ &nbsp;maka &nbsp;A+B+C adalah ….</p>', '', '', 'default.jpg', 5, 1, 0),
(12, 2, 5, 'aeae4943a359a20o52eo', '<p>Jika nilai <i>x</i> dan <i>y</i> memenuhi pengurangan matriks</p><p>$\\left[\\begin{array}{cc}-1 &amp; 2 \\\\ x-y &amp; 3\\end{array}\\right]-\\left[\\begin{array}{cc}2 &amp; 3 \\\\ 1 &amp; x+y\\end{array}\\right]=\\left[\\begin{array}{cc}1 &amp; 5 \\\\ 3 &amp; 7\\end{array}\\right]$</p><p>maka nilai $2 x-y$ adalah ….</p>', '', '', 'default.jpg', 5, 1, 0),
(13, 2, 5, '584o1496u4743a413856', '<p>Diketahui matriks $A=\\left[\\begin{array}{ll}3 &amp; 0 \\\\ 2 &amp; 0\\end{array}\\right] ; B=\\left[\\begin{array}{ll}2 &amp; 1 \\\\ 3 &amp; 2\\end{array}\\right]$ dan &nbsp;<i>A+B=C</i>, maka invers matriks <i>C</i> adalah ….</p>', '', '', 'default.jpg', 1, 1, 0),
(14, 2, 5, 'a6o8060u4a27oa448373', '<p>Suku ke-5 sebuah deret aritmetika adalah 255 dan suku ke-8 adalah 210. Supaya suku ke-<i>n</i> sama dengan 0, maka nilai <i>n</i> adalah ….</p>', '', '', 'default.jpg', 5, 1, 0),
(15, 2, 5, 'ea9aa0u221o0385205e5', '<p>Sebuah laptop dibeli dengan harga Rp20.000.000,00</p><p>Setiap tahun harga jualnya $\\frac{4}{5}$ dari harga sebelumnya. Nilai jual setelah dipakai 3 tahun adalah</p>', '', '', 'default.jpg', 2, 1, 0),
(16, 2, 5, 'u8855067094uu253e467', '<p>Diagram berikut menunjukkan bidang studi yang disukai oleh 72 siswa.</p>', '<p>Banyak siswa yang menyukai Matematika adalah ....</p>', '2', '1623588151_d2456519c4b4f3e28df9.jpg', 3, 1, 0),
(17, 2, 5, '70e29u8u604e47u6uo39', '<p>Peminat Program Studi A, B, C, D, dan E pada penerimaan mahasiswa baru tahun 2020/2021 diperlihatkan pada diagram batang berikut.</p>', '<p>Banyaknya peminat program studi B yang dinyatakan dalam persentase (%) adalah .…</p>', '2', '1623588349_99d5da0c1ecf34cdd58e.jpg', 1, 1, 0),
