(105, 1, 4, '7au33uo1418o0810o61u', '<p class=\"MsoListParagraphCxSpFirst\" style=\"margin:0cm;margin-bottom:.0001pt;\r\nmso-add-space:auto;line-height:normal\"><span style=\"font-size:10.0pt;\r\nfont-family:&quot;Times New Roman&quot;,&quot;serif&quot;\" lang=\"EN-US\">Have you ever seen a giraffe at the zoo? Giraffes are the tallest animals in the world. The average height of a giraffe is 16-18 feet tall. This animal has a very long neck and legs. Giraffe eats the leaves from tall trees. Other animals cannot reach that high. Male giraffes are even taller than female giraffes.<o:p></o:p></span></p><p class=\"MsoListParagraphCxSpLast\" style=\"margin:0cm;margin-bottom:.0001pt;\r\nmso-add-space:auto;line-height:normal\"><span style=\"font-size:10.0pt;\r\nfont-family:&quot;Times New Roman&quot;,&quot;serif&quot;\" lang=\"EN-US\">The main idea of the passage is that …<o:p></o:p></span></p>', '', '', 'default.jpg', 2, 1, 0),
