(134, 3, 14, '09o05uuo3o8780u91006', '<p class=\"MsoNormal\" style=\"margin-left:24.75pt;text-indent:-24.75pt;tab-stops:\r\n54.0pt 99.0pt\"><i style=\"mso-bidi-font-style:normal\"><span style=\"font-size:10.0pt\" lang=\"EN-US\">Rara</span></i><span style=\"font-size:10.0pt\" lang=\"EN-US\">: “Look, the problem is that you’ve been working too much this week.”<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-left:24.75pt;text-indent:-24.75pt;tab-stops:\r\n54.0pt 99.0pt\"><i style=\"mso-bidi-font-style:normal\"><span style=\"font-size:10.0pt\" lang=\"EN-US\">Lisa</span></i><span style=\"font-size:10.0pt\" lang=\"EN-US\">: “You could be right. So, …”<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-left:24.75pt;text-indent:-24.75pt;tab-stops:\r\n54.0pt 99.0pt\"><i style=\"mso-bidi-font-style:normal\"><span style=\"font-size:10.0pt\" lang=\"EN-US\">Rara</span></i><span style=\"font-size:10.0pt\" lang=\"EN-US\">: “You’d better take a rest for a while.”<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-left:24.75pt;text-indent:-24.75pt;tab-stops:\r\n54.0pt 99.0pt\"><i style=\"mso-bidi-font-style:normal\"><span style=\"font-size:10.0pt\" lang=\"EN-US\">Lisa</span></i><span style=\"font-size:10.0pt\" lang=\"EN-US\">: “Thank you for your suggestion.”<o:p></o:p></span></p>', '', '', 'default.jpg', 1, 1, 0),
