(172, 2, 8, 'o621o629uaa176490u55', '<p><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-ansi-language:EN-US;mso-fareast-language:\r\nEN-US;mso-bidi-language:AR-SA\">Kondisi pelabuhan Pangkal Balam saat ini tidak tertata dengan baik akibat penempatan barang muatan tidak sesuai dengan tempatnya. Ditambah lagi persoalan sedimentasi di sepanjang alur pelayaran masuk dan keluar pelabuhan. serta sistem buka tutup (<i style=\"mso-bidi-font-style:\r\nnormal\">bascule</i>) jembatan emas yang sangat mempengaruhi pergerakan kapal. Pelabuhan Pangkal Balam dapat pula dikembangkan sebagai pelabuhan pariwisata dengan pengoperasian <i style=\"mso-bidi-font-style:normal\">mini cruise</i>. Hal baru yang dapat dikembangkan untuk Pelabuhan Pangkal Balam<s> </s>adalah potensi pariwisata dan wisata kuliner. Penyediaan baru yang perlu dipersiapkan adalah <i style=\"mso-bidi-font-style:normal\">port of call</i> dengan <i style=\"mso-bidi-font-style:normal\">mini cruise</i> yang bekerja sama dengan <i style=\"mso-bidi-font-style:normal\">cruise</i> dan <i style=\"mso-bidi-font-style:\r\nnormal\">Mega Cruise</i> internasional yang memiliki rute Singapura dan Malaysia.</span></p>', '<p><i style=\"mso-bidi-font-style:normal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;mso-ansi-language:EN-US;mso-fareast-language:EN-US;\r\nmso-bidi-language:AR-SA\">Pernyataan yang tidak sesuai dengan teks di atas adalah…</span></i></p>', '', 'default.jpg', 2, 0, 1),
(173, 1, 1, '50379e30eaua3693315e', '<p>Jika&nbsp; $f(x)=\\frac{2 x^{3}-3}{2 x+1}$, maka nilai $f(0)+f^{\\prime}(0)$ adalah ….</p>', '', '', 'default.jpg', 2, 1, 0),
(174, 2, 8, '6e39uauaeo48e1u562a4', '<p><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;mso-ansi-language:EN-US;mso-fareast-language:\r\nEN-US;mso-bidi-language:AR-SA\">(1) Pernahkah ibu merasa stres karena Si Kecil suka pilih-pilih makanan (<em>picky eater</em>).<span style=\"mso-spacerun:yes\">&nbsp; </span>(2) Jangan takut dulu, keadaan semacam itu pernah dialami oleh sebagian besar orang tua.<span style=\"mso-spacerun:yes\">&nbsp; </span>(3) Hasil penelitian menunjukkan bahwa sebesar 33,6 % anak prasekolah di Jakarta mengalami masalah sulit makan. (4) Sulit makan dapat menimbukan penyakit kurang gizi. (5) Beberapa tanda anak yang&nbsp;<em>picky eater</em>&nbsp;adalah anak tidak ingin mencoba jenis makanan baru</span></p>', '<p style=\"margin:0cm;margin-bottom:.0001pt;text-align:justify;background:white\"><i style=\"mso-bidi-font-style:normal\">Kalimat yang tidak mendukung gagasan utama paragraf di atas adalah kalimat nomor….</i></p>', '', 'default.jpg', 4, 0, 1),
(175, 2, 8, 'o50828uoo60aoe01a3ao', '<p><span style=\"font-size:12.0pt;font-family:\r\n&quot;Times New Roman&quot;,serif;mso-fareast-font-family:&quot;Times New Roman&quot;;mso-ansi-language:\r\nIN;mso-fareast-language:EN-US;mso-bidi-language:AR-SA\" lang=\"IN\">Promosi yang dilakukan perusahaan telekomunikasi agar dapat bersaing yaitu bauran promosi. Pada bauran promosi terdapat lima macam promosi yang dapat dilakukan suatu perusahaan untuk memperkenalkan produknya kepada masyarakat. Promosi tersebut yaitu dengan cara periklanan, promosi penjualan, publisitas dan hubungan masyarakat, penjualan pribadi dan pemasaran langsung</span>.</p>', '<p><i style=\"mso-bidi-font-style:normal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;mso-ansi-language:IN;mso-fareast-language:EN-US;mso-bidi-language:\r\nAR-SA\" lang=\"IN\">Gagasan utama dari teks di atas adalah…</span><span style=\"font-size:\r\n12.0pt;font-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:&quot;Times New Roman&quot;;\r\nmso-ansi-language:EN-US;mso-fareast-language:EN-US;mso-bidi-language:AR-SA\">.</span></i></p>', '', 'default.jpg', 1, 0, 1),
(176, 2, 8, '8767481805379e7ee59o', '<p class=\"MsoNormal\" style=\"margin-left:17.55pt;text-indent:-17.55pt\"><span style=\"background:white\">(1) <span style=\"mso-tab-count:1\"> </span>Kondisi ini dalam dunia medis dikenal dengan <i style=\"mso-bidi-font-style:normal\">proteinuria</i>. <o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-left:17.55pt;text-indent:-17.55pt\"><span style=\"background:white\">(2) <span style=\"mso-tab-count:1\"> </span>Tingginya kadar protein dalam urine bisa menjadi tanda penyakit ginjal. <o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-left:17.55pt;text-indent:-17.55pt\"><span style=\"background:white\">(3) <span style=\"mso-tab-count:1\"> </span>Kadar protein urine yang secara konsisten tinggi bisa jadi tanda gangguan penyakit ginjal.</span><o:p></o:p></p><p class=\"MsoNormal\" style=\"margin-left:17.55pt;text-indent:-17.55pt\"><span style=\"background:white\">(4) <span style=\"mso-tab-count:1\"> </span>Normalnya, kadar protein urine adalah rendah. <o:p></o:p></span></p><p><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;background:white;mso-ansi-language:EN-US;mso-fareast-language:\r\nEN-US;mso-bidi-language:AR-SA\">(5)&nbsp;Namun untuk orang yang sedang berolah raga atau sakit, kadar protein urine sesekali dapat meningkat. </span></p>', '<p><i style=\"mso-bidi-font-style:normal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;mso-ansi-language:EN-US;mso-fareast-language:EN-US;\r\nmso-bidi-language:AR-SA\">Urutan kalimat yang baik dari pernyataan di atas adalah ….</span></i></p>', '', 'default.jpg', 1, 0, 1),
(177, 1, 1, '4541e4u522e3910452a4', '<p>Turunankeduadarifungsi $f(x)=x^{4}-\\frac{1}{x}$ adalah ….</p>', '', '', 'default.jpg', 1, 1, 0),
(178, 1, 1, '2u046ue73a4a0297488a', '<p>Jika $f(x)=\\cos ^{3}\\left(\\frac{\\pi}{4}-x\\right)$<!--[if gte msEquation 12]><m:oMath><i\r\n style=\'mso-bidi-font-style:normal\'><span lang=PT-BR style=\'font-size:10.0pt;\r\n font-family:\"Cambria Math\",\"serif\";mso-ansi-language:PT-BR\'><m:r>,</m:r></span></i></m:oMath><![endif]--> &nbsp;maka nilai $f^{\\prime}(0)$ adalah ….</p>', '', '', 'default.jpg', 2, 1, 0),
(179, 2, 8, '8o8e19a50407o18u0933', '<p>Kondisi pelabuhan Pangkal Balam saat ini tidak tertata dengan baik akibat penempatan barang muatan tidak sesuai dengan tempatnya. Ditambah lagi persoalan sedimentasi di sepanjang alur pelayaran masuk dan keluar pelabuhan. serta sistem buka tutup <em>(bascule)</em> jembatan emas yang sangat mempengaruhi pergerakan kapal. Pelabuhan Pangkal Balam dapat pula dikembangkan sebagai pelabuhan pariwisata dengan pengoperasian <em>mini cruise</em>. Hal baru yang dapat dikembangkan untuk Pelabuhan Pangkal Balam adalah potensi pariwisata dan wisata kuliner. Penyediaan baru yang perlu dipersiapkan adalah port of call dengan mini cruise yang bekerja sama dengan cruise dan <em>Mega Cruise</em> internasional yang memiliki rute Singapura dan Malaysia.</p><p>Pernyataan yang tidak sesuai dengan teks di atas adalah….</p>', '', '', 'default.jpg', 2, 1, 0),
(180, 2, 8, '8386303765u5e231aae7', '<p class=\"MsoNormal\" style=\"text-align:justify;tab-stops:22.95pt\">(1) Pernahkah ibu merasa stres karena Si Kecil suka pilih-pilih makanan (<em>picky eater</em>).<span style=\"mso-spacerun:yes\">&nbsp; </span>(2) Jangan takut dulu, keadaan semacam itu pernah dialami oleh sebagian besar orang tua.<span style=\"mso-spacerun:yes\">&nbsp; </span>(3) Hasil penelitian menunjukkan bahwa sebesar 33,6 % anak prasekolah di Jakarta mengalami masalah sulit makan. (4) Sulit makan dapat menimbukan penyakit kurang gizi. (5) Beberapa tanda anak yang&nbsp;<em>picky eater</em>&nbsp;adalah anak tidak ingin mencoba jenis makanan baru.<o:p></o:p></p><p style=\"margin:0cm;margin-bottom:.0001pt;background:white\"><o:p>&nbsp;</o:p></p><p style=\"margin:0cm;margin-bottom:.0001pt;text-align:justify;background:white\"><i style=\"mso-bidi-font-style:normal\">Kalimat yang tidak mendukung gagasan utama paragraf di atas adalah kalimat nomor….<o:p></o:p></i></p>', '', '', 'default.jpg', 4, 1, 0),
(181, 2, 8, '98ee72094391949ue513', '<p class=\"MsoNormal\" style=\"text-align:justify;tab-stops:22.95pt\"><span style=\"mso-ansi-language:IN\" lang=\"IN\">Promosi yang dilakukan perusahaan telekomunikasi agar dapat bersaing yaitu bauran promosi. Pada bauran promosi terdapat lima macam promosi yang dapat dilakukan suatu perusahaan untuk memperkenalkan produknya kepada masyarakat. Promosi tersebut yaitu dengan cara periklanan, promosi penjualan, publisitas dan hubungan masyarakat, penjualan pribadi dan pemasaran langsung. <s><o:p></o:p></s></span></p><p class=\"MsoNormal\" style=\"tab-stops:54.0pt 99.0pt\"><span style=\"mso-ansi-language:IN\" lang=\"IN\"><o:p>&nbsp;</o:p></span><i style=\"mso-bidi-font-style:\r\nnormal\"><span style=\"mso-ansi-language:IN\" lang=\"IN\">Gagasan utama dari teks di atas adalah…</span>.<o:p></o:p></i></p>', '', '', 'default.jpg', 1, 1, 0),
(182, 2, 8, '8o943o58oou431o57220', '<p class=\"MsoNormal\" style=\"margin-left:17.55pt;text-indent:-17.55pt\"><span style=\"background:white\">(1) <span style=\"mso-tab-count:1\"> </span>Kondisi ini dalam dunia medis dikenal dengan <i style=\"mso-bidi-font-style:normal\">proteinuria</i>. <o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-left:17.55pt;text-indent:-17.55pt\"><span style=\"background:white\">(2) <span style=\"mso-tab-count:1\"> </span>Tingginya kadar protein dalam urine bisa menjadi tanda penyakit ginjal. <o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-left:17.55pt;text-indent:-17.55pt\"><span style=\"background:white\">(3) <span style=\"mso-tab-count:1\"> </span>Kadar protein urine yang secara konsisten tinggi bisa jadi tanda gangguan penyakit ginjal.</span><o:p></o:p></p><p class=\"MsoNormal\" style=\"margin-left:17.55pt;text-indent:-17.55pt\"><span style=\"background:white\">(4) <span style=\"mso-tab-count:1\"> </span>Normalnya, kadar protein urine adalah rendah. <o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-left:17.55pt;text-indent:-17.55pt\"><span style=\"background:white\">(5) <span style=\"mso-tab-count:1\"> </span>Namun untuk orang yang sedang berolah raga atau sakit, kadar protein urine sesekali dapat meningkat. <o:p></o:p></span></p><p><span style=\"font-size:12.0pt;font-family:\" times=\"\" new=\"\" roman=\"\"><i style=\"mso-bidi-font-style:normal\">Urutan kalimat yang baik dari pernyataan di atas adalah …</i></span></p>', '', '', 'default.jpg', 1, 1, 0),
