(210, 3, 10, '464u88o9919567787057', '<p>Vaksinasi harus diberikan kepada ayam, sebagai bentuk kekebalan terhadap suatu penyakit. Setiap 100 ekor ayam, minimal memerlukan 9 unit zat A dan 15 unit zat B. Di pasar tersedia dua jenis vaksin, yaitu VAKSINO dan VAKSINI. Satu bungkus VAKSINO mengandung 1 unit zat A dan 2 unit zat B, sedangkan satu bungkus VAKSINI mengandung 2 unit zat A dan 1 unit zat B. Banyak VAKSINO dan VAKSINI yang diperlukan untuk 100 ekor ayam adalah ....</p>', '', '', 'default.jpg', 5, 1, 0),
