(216, 1, 3, 'u062ooaa8110504e7838', '<p>Penyambungan benang secara manual menggunakan tangan masih dilakukan di PT Primissima Textil, padahal penenunannya sendiri telah menggunakan mesin modern ITEMA. Akibatnya, sering dijumpai cedera punggung pada Lempeng L5/S1. Perancangan alat bantu penyambung benang untuk mengurangi gaya kompresi L5/S1 sangat diperlukan. Dimensi alat bantu dihitung menggunakan analisis antropometri. Adapun dan dimensi tubuh operator dihitung menggunakan analisis biomekanika dengan mesin ITEMA. Besarnya gaya kompresi punggung dihitung berdasarkan hukum Newton I kesetimbangan =0,=0.=0. Hasil penelitian menjumpai nilai faktor keamanan batasan NIOSH (National Institute for Occupational Safety and Health) untuk alat bantu yang dihasilkan adalah kurang dari 6500N atau 3,4KN (Maximum Permissible Limit). (sumber: ejournal.widyamataram.ac.id dengan perubahan)</p><p>Pernyataan yang sesuai dengan teks di atas adalah …</p>', '', '', 'default.jpg', 4, 1, 0),
(217, 1, 3, '282ue84a52e7922o8u25', '<p>Bahan bakar berbasis fosil untuk masa yang akan datang jumlahnya akan semakin menurun. Bahan bakar untuk mengantisipasinya memerlukan bahan baku lain yaitu biomassa yang berasal dari tumbuhan. Biomassa merupakan sumber energi terbarukan yang sifatnya serbaguna karena dapat menghasilkan bahan bakar untuk pemanas, listrik dan transportasi. Biomassa dapat langsung digunakan sebagai bahan bakar utama. Akan tetapi karena sifat fisiknya yang rendah seperti kerapatan massa yang kecil dan permasalahan dalam penanganan, penyimpanan dan transportasinya sehingga perlu dilakukan upaya pemadatan massa kayu dengan dibuat produk pelet. (Jurnal Penelitian Hasil Hutan, 30(2), 144-154.)</p><p>Gagasan utama yang sesuai dengan teks di atas adalah …</p>', '', '', 'default.jpg', 3, 1, 0),
(218, 1, 3, '975eae969u9o4ae338ue', '<p>(1) Lomba blog dan vlog yang diadakan oleh Kemendikbud mempunyai beberapa tujuan. (2) Lomba ini memperluas publikasi dari substansi Rangkaian Sedaring (seminar daring) Kurikulum Kondisi Khusus dan Relaksasi Pembelajaran Tatap Muka di zona kuning. (3) Kegiatan ini dapat memberikan wadah berekspresi dan berkompetisi bagi para penulis blog dan pembuat vlog. (4) Dapat memberikan daya tarik agar peserta tetap setia mengikuti seminar. (5) Sedaring ini mampu menyampaikan pesan praktis terkait kebijakan pembelajaran di masa pandemi Covid-19.&nbsp;</p><p>Kalimat yang tidak mendukung gagasan utama paragraf di atas adalah kalimat ke-….</p>', '', '', 'default.jpg', 4, 1, 0),
(219, 1, 3, '07uo215471024e0a4395', '<ol><li>Hal itu dilakukan, sebab menciptakan sumber daya manusia (SDM) unggul harus bersifat holistik dan tidak terfokus pada kemampuan kognitif saja.</li><li>Pengenalan ini guna menciptakan Pelajar Pancasila atau pelajar yang memiliki ciri berakhlak mulia, berkebhinekaan global, bergotong royong, mandiri, bernalar kritis, dan kreatif.</li><li>Strategi secara holistik ini dilakukan dengan menciptakan keteladanan bagi pelajar.</li><li>Kemendikbud terus berusaha&nbsp;mengenalkan&nbsp;nilai- nilai&nbsp;Pancasila&nbsp;kepada&nbsp;pelajar&nbsp;milenial.</li></ol><p> </p><p>Agar menjadi paragraf yang baik, kalimat yang tersusun secara acak tersebut diurutkan menjadi ….</p>', '', '', 'default.jpg', 1, 1, 0),
