(254, 1, 1, 'o680993423396707a3a9', '<p>Seorang petani memiliki lahan seluas $60 \\mathrm{ha}$ yang di tanami jagung dan kedelai. Untuk memenuhi kebutuhan pasar, ia harus menanam jagung minimal $10 \\mathrm{ha}$ dan menanam kedelai minimal $20 \\mathrm{ha} .$. Persediaan pupuknya hanya memungkinkan ia menanam kedelai maksimal empat kali lipat jagung. Jika keuntungan penjualan jagung adalah Rp $10.000 .000$, -per $h a$ dan keuntungan penjualan kedelai adalah Rp $6.000 .000$ - per ha, maka keuntungan maksimal yang dapat diperoleh petani adalah ….</p>', '', '', 'default.jpg', 4, 1, 0),
(255, 3, 13, '4633o01uu8892o9a428o', '<p>Kondisi pelabuhan Pangkal Balam saat ini tidak tertata dengan baik akibat penempatan barang muatan tidak sesuai dengan tempatnya. Ditambah lagi persoalan sedimentasi di sepanjang alur pelayaran masuk dan keluar pelabuhan. serta sistem buka tutup (bascule) jembatan emas yang sangat mempengaruhi pergerakan kapal. Pelabuhan Pangkal Balam dapat pula dikembangkan sebagai pelabuhan pariwisata dengan pengoperasian mini cruise. Hal baru yang dapat dikembangkan untuk Pelabuhan Pangkal Balam adalah potensi pariwisata dan wisata kuliner. Penyediaan baru yang perlu dipersiapkan adalah port of call dengan mini cruise yang bekerja sama dengan cruise dan Mega Cruise internasional yang memiliki rute Singapura dan Malaysia.</p><p>Pernyataan yang tidak sesuai dengan teks di atas adalah….</p>', '', '', 'default.jpg', 2, 1, 0),
