(347, 3, 11, '5e238auo73715u3307eo', '<p>Kecepatan&nbsp;aliran darah pada Aorta Abdominalis seorang pasien Covid-19 adalah 0,15 m/s. Luas penampang Aorta adalah 7 x $10^{-4} \\mathrm{~m}^{2}$ . Besarnya laju aliran volume darah yang mengalir adalah … $\\mathrm{m}^{5} / \\mathrm{s}$ .</p>', '', '', 'default.jpg', 2, 1, 0),
(348, 3, 11, 'a169893277u3019u12oo', '<p>Sebuah gunung es mengapung di permukaan laut sebesar 10% . Jika massa jenis air laut sebesar 1,03 $\\mathrm{gram} / \\mathrm{cm}^{3}$ maka massa jenis gunung es tersebut sebesar … $\\mathrm{gram} / \\mathrm{cm}^{3}$ .</p>', '', '', 'default.jpg', 3, 1, 0),
(349, 3, 11, '1738877ao86809o64860', '<p>Hasil pengukuran benda kerja (gasing) dengan menggunakan jangka sorong, pada gambar berikut adalah... mm.</p>', '', '3', '1623623257_cafb4bac40ddf01832cd.jpg', 1, 1, 0),
(350, 3, 11, 'oee218ua73306148eu68', '<p>Resultan dari vektor-vektor pada gambar di bawah adalah ... N.</p>', '', '3', '1623623354_e367a073e68b1ed49d43.jpg', 1, 1, 0),
(351, 3, 11, '6818437e377o0o11o477', '<p>Sebuah mobil bergerak dengan kecepatan 36 km/jam, kemudian mobil dipercepat dengan percepatan2 m/s$<samp>^{2}</samp>$&nbsp;. Jarak yang ditempuh mobil setelah dipercepat selama 5 sekon adalah ... m.</p>', '', '', 'default.jpg', 3, 1, 0),
(352, 3, 11, '8952295u95a6147o1a29', '<p>Roda pada mobil pada mulanya berputar dengan kelajuan sudut 10 rad/s, kemudian berhenti berputar setelah mengelilingi roda adalah … rad/s$<samp>^{2}</samp>$.</p>', '', '', 'default.jpg', 1, 1, 0),
(353, 3, 11, '614u9e1e003310965ee7', '<p>Sebuah pesawat terbang membawa paket bantuan untuk korban bencana alam. Pesawat itu terbang dengan kecepatan 10 m/s pada ketinggian jelajah 125 m di atas permukaan, seperti pada gambar berikut.</p>', '<p>Apabila nilai percapatan gravitasi 10 m/s$<samp>^{2}</samp>$ jarak paket bantuan harus dilepaskan, agar tepat mengenai sasaran adalah ... m dari sasaran.</p>', '2', '1623623904_382e2ea90dbd0bc02b52.jpg', 5, 1, 0),
(354, 3, 11, '7u985272a0389793934a', '<p>Sebuah balok massa 2 kg berada diatas bidang horizontal tanpa gesekan, ditarik dengan gaya 10 N sejajar bidang selama 4 sekon. Jarak benda pada saat sekon dari titik awal gerakan adalah ... meter.</p>', '', '', 'default.jpg', 3, 1, 0),
(355, 3, 11, '2e665aua380o289u51e4', '<p>Sebuah bola pejal (momen inersia I = $2 / 5 \\mathrm{mr}^{2}$) ,&nbsp; menggelinding di atas bidang miring dari ketinggian h.&nbsp; Bila kecepatan silinder tersebut saat mencapai bidang datar adalah 2 m/s, maka ketinggian h adalah ... m</p>', '', '1', '1623624299_a7b7aaa3937ca6b87d10.jpg', 3, 1, 0),
(356, 3, 11, '683u378u9o975o326162', '<p>Sebuah balok massanya 4 kg yang terletak pada bidang datar kasar diberi gaya konstan sebesar 40 N membentuk sudut 37° terhadap bidang horizontal. Jika koefisien gesek antara balok dan lantai 0,2 maka besar kecepatan benda setelah 5 detik adalah ... m/s.$\\left(\\mathrm{g}=10 \\mathrm{~m} / \\mathrm{s}^{2}\\right)$</p>', '', '', 'default.jpg', 3, 1, 0),
(357, 3, 11, '59a63306o717a1752e86', '<center><h4><b>5&nbsp;m</b></h4></center><p> </p><p>Sebuah balok&nbsp; dengan massa 5 kg didorong gaya 20 N seperti gambar di atas. Balok tersebut bergerak sejauh 5 m. maka kerja yang dilakukan oleh gaya tersebut adalah ... J.</p>', '', '1', '1623624865_d66cff3bae3f12d4b04c.jpg', 2, 1, 0),
(358, 3, 11, '292ue45ou69e210aaa22', '<p>Sebuah benda diam massa 1 kg berada di atas bidang miring dengan koefisien gesekan $1 / 2 \\sqrt{3}$ dengan sudut kemiringan $60^{\\circ}$. Benda dilepas dari keadaan diam sehingga&nbsp; meluncur &nbsp;kebawah sepanjang bidang miring. Saat benda berada pada jarak 10 meter dari posisi awal, gerakan energi kinetiknya adalah ... J.</p>', '', '', 'default.jpg', 4, 1, 0),
(359, 3, 11, 'eo312ee3ua1672519o88', '<p>Mobil yang &nbsp;massanya 750 kg &nbsp;melaju dengan kecepatan 36 km/jam &nbsp;menabrak pohon dan berhenti dalam waktu 0,2 sekon kemudian. Gaya impuls yang dialam imobilsaat menabrak pohon tersebut</p><p>adalah... N.</p>', '', '', 'default.jpg', 5, 1, 0),
(360, 3, 11, '7a17u32a3ou245208u8a', '<p>Seorang pembalap formula yang massanya 70 kg, melaju dengan kecepatan 180 km/jam. Jika massa mobil formula 230 kg, momentum mobil dan pembalapnya adalah ... kg.m/s.</p>', '', '', 'default.jpg', 3, 1, 0),
(361, 3, 11, '117435o104ua9555a431', '<p>Dua benda A dan B bergerak saling berlawanan arah dengan kecepatan 2 m/s dan 1 m/s sehingga bertumbukan secara sentral. Tumbukan kedua benda&nbsp;bersifat elastis sempurna sehingga kecepatan kedua benda setelah tumbukan berubah menjadi 1m/s dan 2 m/s dengan arah berlawanan dari arah semula. Jika massa benda&nbsp; A sebesar 1 kg, maka massa benda B sebesar … kg.</p>', '', '', 'default.jpg', 4, 1, 0),
(362, 3, 11, '4374a100409608463241', '<p>Sebuah benda ditarik oleh pegas yang memiliki konstanta 500 N/m. Jika gaya yang digunakan untuk menarik benda tersebut sebesar 5 N, maka pegasakan bertambah panjang sebesar … c</p>', '', '', 'default.jpg', 5, 1, 0),
(363, 3, 11, '84121o404e5u14590019', '<p>Pada sebuah pipa U, terdapat air dengan massa jenis 1000 $\\mathrm{kg} / \\mathrm{m}^{3}$ . Kemudian diisi zat cair lain pada pipa sebelah kiri hingga mencapai ketinggian 8 cm. Jika perbedaan ketinggian kedua zat cair adalah 2 cm, maka massa jenis zat cair tersebut adalah ... $\\mathrm{kg} / \\mathrm{m}^{3}$ .</p>', '', '', 'default.jpg', 3, 1, 0),
(364, 3, 11, 'u6au4a863019u1ua3839', '<p>Sebuah tandon air berada di ketinggian 4 m di atas tanah. Tinggi tandon 80 cm dan pada bagian dasarnya terdapat lubang dengan luas 2 $\\mathrm{cm}^{2}$ . Jika&nbsp; massa jenis air sebesar 1 gram/$\\mathrm{cm}^{3}$ , maka massa air yang keluar dari tandon selama satu menit sebesar ... kg.</p><p>(g = 10$\\mathrm{m} / \\mathrm{s}^{2}$)</p>', '', '', 'default.jpg', 5, 1, 0),
(365, 3, 11, 'u81152uuua7o0e9u0311', '<p>Perhatikan gambar di bawah ini !</p>', '<p>Sebuah pegas mempunyai panjang mula-mula yaitu 18 cm, setelah mendapatkan gaya sebesar 10 N panjang pegas menjadi 30 cm, panjang pegas jika diregangkan dengan gaya 12 N adalah ... cm.</p>', '2', '1623625801_ea81b90293dfc2d4b203.jpg', 4, 1, 0),
(366, 3, 11, 'a4201ea2e51496140a6o', '<p>Seutas senar gitar dipetik beberapa kali dengan amplitudo yang berbeda-beda. Jika variasi amplitudo yang diberikan adalah 0,5 cm; 1 cm; 1,5 cm; 2 cm; dan 2,5 cm, maka energi mekanik terkecil diperoleh saat amplitudonya bernilai … cm.</p>', '', '', 'default.jpg', 1, 1, 0),
(367, 3, 11, '9798u1aa415o18e12e3u', '<p><i>Ball bearing&nbsp;</i>sepeda terbuat dari perunggu (koefisien mulai panjang α = 18 x 10<sup>-6</sup> $m^{\\circ} \\mathrm{C}$) pada suhu 0 °C jari-jarinya 100 cm. Jika <i>ball bearing&nbsp;</i>tersebut dipanaskan sampai $75^{\\circ} \\mathrm{C}$ maka pertambahan luas permukaan adalah... $m^{2}$ .</p>', '', '', 'default.jpg', 3, 1, 0),
(368, 3, 11, '3192u431eo41uu2o396e', '<p>Seorang &nbsp;tukang es mengubah 1 kg air dengan suhu 2$20^{\\circ} \\mathrm{C}$ &nbsp;menjadi es yang bersuhu $-10^{\\circ} \\mathrm{C}$ . Banyaknya energi yang harus dikeluarkan adalah ... kkal.</p><p>($\\mathrm{C}_{\\mathrm{air}}=1 \\mathrm{kal} / \\mathrm{gr}^{\\circ} \\mathrm{C} ; \\mathrm{C}_{e s}=0,5 \\mathrm{kal} / \\mathrm{gr}^{\\circ} \\mathrm{C} ; \\mathrm{L}_{e s}=80 \\mathrm{kal} / \\mathrm{gr}$)</p>', '', '', 'default.jpg', 3, 1, 0),
(369, 3, 11, 'o381a4e86ao134u6ee40', '<p>Dua batang logam A dan B mempunyai ukuran sama, disambungkan satu sama lain pada salah satu ujungnya.</p>', '<p>Jika suhu ujung bebas logam&nbsp; A $210^{\\circ} \\mathrm{C}$ dan di ujung bebas logam $\\mathrm{B} 30^{\\circ} \\mathrm{C}$ dan koefisien konduksi kalor logam A adalah dua kali koefisien konduksi logam B makasuhu pada sambungan kedua logam adalah …${ }^{\\circ} \\mathrm{C}$.</p>', '2', '1623626120_09b6d2d928904f76b867.jpg', 4, 1, 0),
(370, 3, 11, '0156u62ee6o9169u4281', '<p>Dua muatan yang sama dipisahkan sejauh 10 cm mempunyai gaya Coulomb $3 \\times 10^{-6} \\mathrm{~N}$ . Pada jarak yang sama ada perubahan kondisi:</p><p>a.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; masing-masing muatan menjadi dua kali muatan awal maka menghasilkan gaya coulomb F1</p><p>b.&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; masing-masing muatan menjadi tiga kali muatan awal maka menghasilkan gaya coulomb F2</p><p>Perbandingan gaya coulomb F1 :&nbsp; F2 adalah ….</p>', '', '', 'default.jpg', 5, 1, 0),
(371, 3, 11, '587e90a067a88a6u097o', '<p>Empat buah kapasitor identik yang memiliki besar masing-masing &nbsp;$24&nbsp; \\mu \\mathrm{F}$ tersusun secara seri. Jika keempat kapasitor tersebut dihubungkan dengan sebuah baterai 12 volt. Tentukan kapasitansilistrik pada keempat resistor... $\\mu \\mathrm{F}$ .</p>', '', '3', '1623626464_c22d140fe5e052a14b59.jpg', 4, 1, 0);
